import React, { useState, useEffect } from 'react';
import OsSdk from './OsSdk.js';


function OtterSkd(drizzle, drizzleState) {
    const [count, setCount] = useState(0);
    const [projectTokenIds, setprojectTokenIds] = useState([]);

    useEffect(() => {
        const fetchStats = async () => { 
   
            var proxyUrl = 'https://cors-anywhere.herokuapp.com/',
            targetUrl = 'https://api.opensea.io/api/v1/collection/';
            const collectionSlug= 'doodles-official/';
            const collection='stats';
           
        
            let i;
            let tokenIdArray= [];
            console.log(tokenIdArray)
            const callsPerProject = 2;
            //console.log(offset)

        
            fetch(targetUrl + collectionSlug + collection,{header:'x-api-key:2f2a0900458f4bdfbb489680a58e7526'})
              .then(res => res.json())
              .then(
                (res) => {
                   console.log(res.stats.count);
                   setCount(res.stats.count)
                },
                (error) => {
                  //setLoading(true),
                  error;
                }
              )
              .then(
                (res) => {
                   //console.log(res.stats.count);
                   //setCount(res.stats.count)
                   for (i = 0; i < count; i++) {
                    //const tokenIdObject = result.data.projects[0].tokens[j];
                    tokenIdArray.push(i)
                  }           
                },
                (error) => {
                  //setLoading(true),
                  error;
                }
              )

     
        }
        fetchStats();
      }, []);
    
  
    return (
      <div>
          jjjjj
        <OsSdk  drizzleState={drizzleState} drizzle={drizzle} count={count} tokenIdArray={tokenIdArray}   />
      </div>
    );
  }

  export default OtterSkd;
